import React from 'react';

const ProductTable = () => {
  // Dummy data array
  const products = [
    { name: 'Apple MacBook Pro 17"', color: 'Silver', category: 'Laptop', price: '$2999' },
    { name: 'Microsoft Surface Pro', color: 'White', category: 'Laptop PC', price: '$1999' },
    { name: 'Magic Mouse 2', color: 'Black', category: 'Accessories', price: '$99' },
  ];

  return (
    <div className="relative overflow-x-auto">
      <table className="w-full text-sm text-left rtl:text-right text-gray-500 dark:text-gray-400" style={{ borderCollapse: 'collapse', minWidth: '600px' }}>
        <thead className="text-xs text-gray-700 uppercase bg-gray-50 dark:bg-gray-700 dark:text-gray-400">
          <tr>
            <th scope="col" className="px-6 py-3 border-b border-gray-200 bg-gray-100 dark:bg-gray-800 dark:border-gray-700">
              Product name
            </th>
            <th scope="col" className="px-6 py-3 border-b border-gray-200 bg-gray-100 dark:bg-gray-800 dark:border-gray-700">
              Color
            </th>
            <th scope="col" className="px-6 py-3 border-b border-gray-200 bg-gray-100 dark:bg-gray-800 dark:border-gray-700">
              Category
            </th>
            <th scope="col" className="px-6 py-3 border-b border-gray-200 bg-gray-100 dark:bg-gray-800 dark:border-gray-700">
              Price
            </th>
          </tr>
        </thead>
        <tbody>
          {products.map((product, index) => (
            <tr key={index} className="bg-white border-b border-gray-200 dark:bg-gray-800 dark:border-gray-700">
              <td className="px-6 py-4 whitespace-nowrap font-medium text-gray-900 dark:text-white">
                {product.name}
              </td>
              <td className="px-6 py-4 whitespace-nowrap">
                {product.color}
              </td>
              <td className="px-6 py-4 whitespace-nowrap">
                {product.category}
              </td>
              <td className="px-6 py-4 whitespace-nowrap">
                {product.price}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ProductTable;
